import { API } from "../../../backend";



export const nowCooking = (user) => {
    console.log(user);
    return fetch(`${API}/admin/nowcooking`, {
        method: "POST",
        headers: {
            Accept: "application/json",

        },
        body: user
    }).then(res => {
        return res.json();
    }).catch(err => console.log(err));
}
